// import logo from './logo.svg';
import './App.css';
import Header from './Components/header';
import Expense from './Components/ExpenseItem';


function App() {

  const expensedata = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];
  return (
    <div>
     <Header></Header>
     <Expense title = {expensedata[0].title}  amount = {expensedata[0].amount} date = {expensedata[0].date}></Expense>
    </div>
  );
}

export default App;
